import React from 'react';

const Headings = () => {
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Headings sizes:</h5>
        </div>

        <div className='row alignCenter mb1'>
          <div className='col3'>
            <p className='fsSM fwBold'>.fsH1:</p>
          </div>

          <div className='col9'>
            <div className='displayFlex alignCenter'>
              <h1 className='h100 fsH1 lh3 fontDefault mx1'>H1</h1>
              <h1 className='h100 fsH1 lh1 fontStyled mx1'>H1</h1>
              <h1 className='h100 fsH1 lh1 fontAccent mx1'>H1</h1>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Headings;
